    _glCoords = null;
    _glNormals = null;
    _glFunction = null;
    _glIndices = null;
    _glColorOrTex = null;
    _glUV = null;
    _glWidth = null;
    _glHeightInSection = null;
    _glSectionHeight = null;
    _glFiltered = null;
    // Data has chaged
    _coordsDirty = false;
    _filteredDirty = false;
